	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 428px; min-height: 428px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 4px; top: 4px; width: 420px; min-height: 420px;\"><p style=\"margin-left:0px;text-indent:0px;line-height:1.173;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\" font-size:22pt; font-family:\'@Yu Gothic UI\', sans-serif; color:#2fb4dc; font-weight:normal; font-style:normal; text-decoration:normal;\">Crown:</span><span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> </span></p> \n<ul style=\"padding:0 0 0 1px;list-style-position:outside;margin-left:15px;text-align:left;\"> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Anatomic Crown: Portion covered with enamel; remains constant throughout life. </span></li> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Clinical Crown: Visible portion; changes as gingiva recedes. </span></li> \n</ul> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.127;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> &nbsp;</span></p> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.173;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\" font-size:22pt; font-family:\'@Yu Gothic UI\', sans-serif; color:#2fb4dc; font-weight:normal; font-style:normal; text-decoration:normal;\">Root:</span><span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> </span></p> \n<ul style=\"padding:0 0 0 1px;list-style-position:outside;margin-left:15px;text-align:left;\"> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Embedded in the alveolar bone, covered with cementum. </span></li> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">May have one (single), two (bifurcation), or three (trifurcation) roots. </span></li> \n</ul> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.127;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> &nbsp;</span></p> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.173;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\" font-size:22pt; font-family:\'@Yu Gothic UI\', sans-serif; color:#2fb4dc; font-weight:normal; font-style:normal; text-decoration:normal;\">Cervix:</span><span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> </span></p> \n<ul style=\"padding:0 0 0 1px;list-style-position:outside;margin-left:15px;text-align:left;\"> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Narrow area where crown and root meet. </span></li> \n <li style=\"padding-left:8px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\" font-size:12pt; font-family:\'Malgun Gothic\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Also known as the cementoenamel junction (CEJ). </span></li> \n</ul> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.127;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\"background-color:transparent;color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Malgun Gothic\', sans-serif;font-style:normal;\"> &nbsp;</span></p> \n<p style=\"margin-left:0px;text-indent:0px;line-height:1.409;margin-top:0px;margin-bottom:0px;\" align=\"left\"> <span style=\"color:#ffffff;font-weight:normal;text-decoration:normal;font-size:12pt;font-style:normal;top:-2px;font-family:\'Malgun Gothic\', sans-serif;\">​ </span></p></div></div>",
